var suma_total_AsisHora = "";
$(document).ready(function () {
    $.ajax({
        url: url_estadisticas_hora,
        dataType: 'json',
        contentType: "application/json; charset=utf-8",
        method: "GET",
        success: function (data) {

            var div_p = document.getElementById("time");
            var table = document.createElement('table');
            table.style.fontSize = "11px";
            div_p.appendChild(table);

            var tr = document.createElement('tr');

            var td_1 = document.createElement('th');
            td_1.innerHTML = 'Horario';
            tr.appendChild(td_1);

            var td_2 = document.createElement('th');
            td_2.innerHTML = 'Día 1';
            td_2.className = 'center-align Columna';
            tr.appendChild(td_2);

            var td_3 = document.createElement('th');
            td_3.innerHTML = 'Día 2';
            td_3.className = 'center-align';
            tr.appendChild(td_3);

            var td_4 = document.createElement('th');
            td_4.innerHTML = 'Día 3';
            td_4.className = 'center-align';
            tr.appendChild(td_4);

            table.appendChild(tr);

            var labels_dias = [];
            var dia_1 = [];
            var dia_2 = [];
            var dia_3 = [];

            var count = 0;
            var count_d2 = 0;
            var count_d3 = 0;
            var counttb = 1;
            var tr;

            var suma_dia1;
            var suma_dia2;
            var suma_dia3;

            var anterior = '';

            data.forEach(function (indice, valor, array) {

                if (counttb === 1) {
                    tr = document.createElement('tr');

                    var td_1 = document.createElement('td');
                    td_1.innerHTML = indice.HoraInicial + ' - ' + indice.HoraFinal;

                    if (indice.HoraInicial !== anterior) {
                        anterior = indice.HoraInicial;
                        tr.appendChild(td_1);
                    }
                }
                if (indice.Dia == 1) {
                    var suma = 0;
                    dia_1[count] = indice.total;
                    labels_dias[count] = indice.HoraInicial;
                    count += 1;

                    var td_2 = document.createElement('td');
                    td_2.innerHTML = indice.total;
                    td_2.className = 'center-align';
                    tr.appendChild(td_2);

                    for (var i = 0; i < dia_1.length; i++) {
                        suma += dia_1[i];
                    }
                    suma_dia1 = suma;
                }
                if (indice.Dia == 2) {
                    var suma2 = 0;
                    dia_2[count_d2] = indice.total;
                    count_d2 += 1;

                    var td_3 = document.createElement('td');
                    td_3.innerHTML = indice.total;
                    td_3.className = 'center-align';
                    tr.appendChild(td_3);

                    for (var a = 0; a < dia_2.length; a++) {
                        suma2 += dia_2[a];
                    }
                    suma_dia2 = suma2;
                }
                if (indice.Dia == 3) {
                    var suma3 = 0;
                    dia_3[count_d3] = indice.total;
                    count_d3 += 1;

                    var td_4 = document.createElement('td');
                    td_4.innerHTML = indice.total;
                    td_4.className = 'center-align';
                    tr.appendChild(td_4);

                    for (var e = 0; e < dia_3.length; e++) {
                        suma3 += dia_3[e];
                    }
                    suma_dia3 = suma3;

                }
                if (counttb === 3) {
                    table.appendChild(tr);
                    counttb = 1;
                } else {
                    counttb++;
                }
            });

            suma_total_AsisHora = suma_dia1 + suma_dia2 + suma_dia3;

            var cajadiv = document.getElementById("mydiv1");
            var texto = document.createTextNode('Total: ' + suma_total_AsisHora);
            cajadiv.appendChild(texto);

            var trtotal = document.createElement('tr');

            var tdTotal = document.createElement('td');
            tdTotal.innerHTML = 'Total:';
            tdTotal.className = 'right-align';
            table.appendChild(trtotal);
            trtotal.appendChild(tdTotal);

            var td_5 = document.createElement('td');
            td_5.innerHTML = suma_dia1;
            td_5.className = 'center-align totalTD';
            trtotal.appendChild(td_5);

            var td_6 = document.createElement('td');
            td_6.innerHTML = suma_dia2;
            td_6.className = 'center-align totalTD';
            trtotal.appendChild(td_6);

            var td_7 = document.createElement('td');
            td_7.innerHTML = suma_dia3;
            td_7.className = 'center-align totalTD';
            trtotal.appendChild(td_7);

//            var colors = colores[idEdicion];
            var graphTarget = $("#AsistenciaHora");
            var barGraph = new Chart(graphTarget, {
                pointDotRadius: 30,
                type: 'line',
                data: {
                    labels: labels_dias,
                    datasets: [{
                            data: dia_1,
                            label: 'Dia 1',
                            lineTension: 0,
                            fill: false,
                            pointStyle: 'circle',
                            borderColor: '#3D6CB8',
                            pointRadius: 5,
                            pointBackgroundColor: '#3D6CB8'

                        }, {
                            data: dia_2,
                            label: 'Dia 2',
                            lineTension: 0,
                            fill: false,
                            pointStyle: 'triangle',
                            borderColor: '#0055D9',
                            pointRadius: 5,
                            pointBackgroundColor: '#0055D9'

                        }, {
                            data: dia_3,
                            label: 'Dia 3',
                            lineTension: 0,
                            fill: false,
                            pointStyle: 'star',
                            borderColor: '#65A1FF',
                            pointRadius: 5,
                            pointBackgroundColor: '#65A1FF'
                        }]
                },
                options: {
//                    responsive: true,
                    "hover": {
                        "animationDuration": 0
                    },
                    legend: {
                        position: 'top',
                        labels: {
                            boxWidth: 10,
                            fontColor: 'black'
                        }
                    }
                }
            });
        }
    });
});

document.getElementById('download-pdf-1').addEventListener("click", downloadPDF);
function downloadPDF() {
    var canvas = document.querySelector('#AsistenciaHora');
    var canvasImg = canvas.toDataURL();
    var imgData = 'data:image/jpeg;base64,';
    var doc = new jsPDF('landscape');
    doc.setFontSize(20);
    doc.addImage(imgData, 'JPEG', 0, 0, 297, 200);
    doc.text("Asistencia por hora", 120, 45);
    doc.text("Total: " + suma_total_AsisHora, 250, 50);
    doc.addImage(canvasImg, 'JPEG', 40, 65, 215, 100);
    doc.save("download.pdf");
}

document.getElementById('download-pdf-3').addEventListener("click", pdf);
function pdf() {
    html2canvas(document.getElementById('time')).then(function (canvas) {
        var image = canvas.toDataURL("image/png");
        var imgData = 'data:image/jpeg;base64,';
        var doc = new jsPDF('landscape');
        doc.setFontSize(20);
        doc.addImage(imgData, 'JPEG', 0, 0, 297, 200);
        doc.text("Asistencia por hora", 110, 45);
        doc.text("Total: " + suma_total_AsisHora, 250, 50);
        doc.addImage(image, 'JPEG', 40, 65, 215, 100);
        doc.save("download.pdf");
    });
}